import React, { Component } from "react";
class App extends Component {
  render() {
    return (
      <div>
        <h1>Hello World</h1>
        <Welcome name="User"></Welcome>
      </div>
    );
  }
}

function Welcome(props) {
  return (<h1>Welcome, {props.name}</h1>);
}

export default App;
